import logo from "./logo.svg";
import "./App.css";
import { Link, Outlet } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <nav>
        <ul>
          <li>
            <Link to="/AzureDataUI"> Create Session </Link>
          </li>
          <li>
            <Link to="/ReadData"> Read Data </Link>
          </li>
        </ul>
      </nav>
      <BrowserRouter>
        <Routes>
          <Route path="/AzureDataUI" element={<App />} />
          <Route path="/ReadData" element={<ReadData />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
